MY ISRAEL (DVD5)

When the stones of Jerusalem become holier than it's people,
 has David become Goliath?

Walls, and ghettos, and Jews, it just won't fit together..

 The extra security reminds you that you're not just going on any trip, and just to make things weirder, this flight is leaving for the Jewish state.. on Christmas eve

 A five part documentary created by Allan Novak and Ralph Benmergui.

